def load_vit_with_cutout(model_name,cut_power, num_cutouts, noise_sd=0, noise_schedule='constant',
                                noise_descending_steps=None,
                                batches=1, checkpointing=False):
    model = timm.create_model(timm_models[model_name]['config']['model_name']).cuda().eval()
    timm.models.load_checkpoint(model, timm_models[model_name]['config']['checkpoint_path'])
    cfg = resolve_data_config({}, model=model, use_test_size=True)
    mean=torch.tensor(cfg["mean"])
    std=torch.tensor(cfg["std"])
    model = NormalizationAndCutoutWrapper(model, size=224,mean=torch.FloatTensor(mean),
                                          std=torch.FloatTensor(std), cut_power=cut_power,
                                          noise_sd=noise_sd, noise_schedule=noise_schedule,
                                          noise_descending_steps=noise_descending_steps,
                                          num_cutouts=num_cutouts, checkpointing=checkpointing, batches=batches)
    model.eval()
    return model

def load_vit(model_name):
    model = timm.create_model(timm_models[model_name]['config']['model_name']).cuda().eval()
    timm.models.load_checkpoint(model, timm_models[model_name]['config']['checkpoint_path'])
    cfg = resolve_data_config({}, model=model, use_test_size=True)
    mean=torch.tensor(cfg["mean"])
    std=torch.tensor(cfg["std"])
    model = NormalizationAndResizeWrapper(model, 224,
                                          mean=torch.FloatTensor(mean),
                                          std=torch.FloatTensor(std))
    model.eval()
    return model